import { Box, Chip, ListItem } from "@mui/material";
import axios from "axios"
import { useEffect, useState } from "react"

const PokeCard = ({data}) => {

    const [currentPokemon, setCurrentPokemon] = useState()

    useEffect(() => {
        axios
            .get(data[0].url)
            .then(res => setCurrentPokemon(res.data))
    }, [data]);

    return (
        <Box sx={ {
            width: 980, 
            height: 500,
            display: 'flex',
        } }>
            <Box>
            {
                data.map(pokemon => {
                    let name = pokemon.name;
                    return (
                        <Chip label={name}/>
                    )
                })
            }
            </Box>

            {
            currentPokemon && 
            <div>
                Hello {currentPokemon.name}!
            </div>
            }

        </Box>
    )
} 

export default PokeCard
